import React from "react";

function EverdayGoal() {
  return (
    <div>
      <div
        style={{
          width: "200px",
          minHeight: "300px",
          backgroundColor: "#FFCEB1",
          zIndex: "2",
          marginLeft: "50px",
        }}
        className="d-flex align-items-center"
      >
        <h4>Add Todays Goal</h4>
      </div>
    </div>
  );
}

export default EverdayGoal;
